WHERE allergies IS NULL;

SELECT *
FROM admissions
WHERE admission_date = discharge_date;

SELECT
    (SELECT COUNT(*) FROM patients WHERE gender = 'M') AS male_count,
    (SELECT COUNT(*) FROM patients WHERE gender = 'F') AS female_count;

select max(number_of_visits) as max_visits,
min(number_of_visits) as min_visits,
round(avg(number_of_visits),2) as average_visits from (select admission_date,count(*) as  number_of_visits from admissions group by admission_date) as daily_admissions;

select province_name from province_names order by
case when province_name='Ontario' then 0 else 1 end,
province_name asc;
